    //@Test
    public void randomTest() {
        CatalogBlockIndices[] allocateds = new CatalogBlockIndices[30];
        for(int i=0; i<allocateds.length; i++) {
            allocateds[i] = new CatalogBlockIndices();
        }
        class Iteration {
            int allocIndex = -1;
            int freeIndex = -1;
            int allocSize = 0;
            int freeSize = 0;
        }
        List<Iteration> iters = new ArrayList<>();
        testWithDriver(new Driver() {
            @Override
            public CatalogBlockIndices getAllocation(int iteration) {
                int index = (int) Math.round(Math.random() * 9);
                iters.add(new Iteration());
                iters.get(iteration).allocIndex = index;
                return allocateds[index];
            }

            @Override
            public int allocationSize(int iteration, long freeBlocks) {
                int hmr = 0;
                if (freeBlocks > 1) {
                    long hm = freeBlocks - 1;
                    hmr = (int) Math.round(Math.random() * hm);
                    if (hmr > 10) {
                        hmr = (int) (Math.round(10 * Math.random()));
                    }
                }
                iters.get(iteration).allocSize = hmr;
                return hmr;
            }

            @Override
            public CatalogBlockIndices getFreeing(int iteration) {
                int index = (int) Math.round(Math.random() * 9);
                iters.get(iteration).freeIndex = index;
                return allocateds[index];
            }

            @Override
            public int freeSize(int iteration, CatalogBlockIndices body) {
                long l = body.getLength();
                int hmr = (int) Math.round(Math.random() * l);
                if (hmr > 10) {
                    hmr = (int) (Math.round(10 * Math.random()));
                }
                iters.get(iteration).freeSize = hmr;
                return hmr;
            }

            @Override
            public void freeAll(final BlockAllocator blockAllocator) {
                for(int i=0; i<allocateds.length; i++) {
                    blockAllocator.free(allocateds[i]);
                }
            }

            @Override
            public int size() {
                return 10000;
            }

            @Override
            public void print(int iteration) {
                System.out.println("Failed on " + iteration);
                StringBuilder sb = new StringBuilder("new int[] {");
                for(int i=0; i<=iteration; i++) {
                    if (i != 0) {
                        sb.append(", ");
                    }
                    sb.append(iters.get(i).allocIndex);
                }
                sb.append("},");
                System.out.println(sb);
                sb = new StringBuilder("new int[] {");
                for(int i=0; i<=iteration; i++) {
                    if (i != 0) {
                        sb.append(", ");
                    }
                    sb.append(iters.get(i).allocSize);
                }
                sb.append("},");
                System.out.println(sb);
                sb = new StringBuilder("new int[] {");
                for(int i=0; i<=iteration; i++) {
                    if (i != 0) {
                        sb.append(", ");
                    }
                    sb.append(iters.get(i).freeIndex);
                }
                sb.append("},");
                System.out.println(sb);
                sb = new StringBuilder("new int[] {");
                for(int i=0; i<=iteration; i++) {
                    if (i != 0) {
                        sb.append(", ");
                    }
                    sb.append(iters.get(i).freeSize);
                }
                sb.append("}");
                System.out.println(sb);
            }
        });
    }

