    public void fixedTest(int[] allocIndex, int[] allocSize, int[] freeIndex, int[] freeSize) {
        CatalogBlockIndices[] allocateds = new CatalogBlockIndices[10];
        for(int i=0; i<allocateds.length; i++) {
            allocateds[i] = new CatalogBlockIndices();
        }
        testWithDriver(new Driver() {
            @Override
            public CatalogBlockIndices getAllocation(int iteration) {
                int index = allocIndex[iteration];
                return allocateds[index];
            }

            @Override
            public int allocationSize(int iteration, long freeBlocks) {
                int hmr = allocSize[iteration];
                return hmr;
            }

            @Override
            public CatalogBlockIndices getFreeing(int iteration) {
                int index = freeIndex[iteration];
                return allocateds[index];
            }

            @Override
            public int freeSize(int iteration, CatalogBlockIndices body) {
                int hmr = freeSize[iteration];
                return hmr;
            }

            @Override
            public void freeAll(final BlockAllocator blockAllocator) {
                for(int i=0; i<allocateds.length; i++) {
                    System.out.println("FINAL FREE u=" + i);
                    blockAllocator.getBlockAllocatorInternal().dump();
                    blockAllocator.free(allocateds[i]);

                }
            }

            @Override
            public int size() {
                return allocIndex.length;
            }

            @Override
            public void print(int iteration) {
                System.out.println("Failed on " + iteration);
            }
        });
    }

    public void testWithDriver(final Driver driver) {
        File file = TestFile.createNewFile("media-3.blck");
        MediaPropertiesBuilder mediaPropertiesBuilder = new MediaPropertiesBuilder();
        mediaPropertiesBuilder.setMaxTotalSize(64*1000);
        mediaPropertiesBuilder.setBlockSize(64);
        Media media = Media.create(file, MediaProperties.from(mediaPropertiesBuilder));

        BlockAllocation blockAllocation = media.getBlockAllocation();
        Assertions.assertEquals(995, blockAllocation.getLockedFreeSize() / 64);
        Assertions.assertEquals(5, blockAllocation.getPayloadSize() / 64);
        Assertions.assertEquals(1000, blockAllocation.getTotalLockedSize() / 64);

        BlockAllocator blockAllocator = media.createSecondaryBlockAllocator("blah",100);

        int k=0;
        for (int u = 0; u < driver.size(); u++) {
            if ( u == driver.size()-1 ) {
                int z=0;
            }
            try {

                CatalogBlockIndices allocated = driver.getAllocation(u);

                int allocSize = driver.allocationSize(u, blockAllocator.getFreeBlocks());
                if (allocSize != 0) {
                    CatalogBlockIndices alloced = blockAllocator.allocate(BlockType.CATALOG,allocSize);
                    allocated.add(alloced);
                }

                allocated = driver.getFreeing(u);
                int freeSize = driver.freeSize(u, allocated);

                if (freeSize != 0) {
                    CatalogBlockIndices extracted = allocated.extract(freeSize);
                    blockAllocator.free(extracted);
                }
                /*System.out.println("u=" + (driver.size()-1));
                blockAllocator.getBlockAllocatorInternal().dump();*/
            } catch (final Exception e) {
                driver.print(u);
                blockAllocator.getBlockAllocatorInternal().dump();
                throw e;
            }
        }

        System.out.println("VERY LAST u=" + (driver.size()-1));
        blockAllocator.getBlockAllocatorInternal().dump();

        driver.freeAll(blockAllocator);
        driver.print(driver.size()-1);
        media.dump();

        Assertions.assertEquals(993, blockAllocation.getLockedFreeSize() / 64);
        Assertions.assertEquals(7, blockAllocation.getPayloadSize() / 64);
        Assertions.assertEquals(1000, blockAllocation.getTotalLockedSize() / 64);

    }

